// Name: Geolocation
// ID: SPgeolocation
// Description: Get the Location of Users
// By: SharkPool
// License: MIT

// Version 1.1.11

(function (Scratch) {
  "use strict";
  if (!Scratch.extensions.unsandboxed) throw new Error("Geolocation must run unsandboxed");

  const menuIconURI =
"data:image/svg+xml;base64,";
  const blockIconURI =
"data:image/svg+xml;base64,";

  let ipCache = { ip: undefined, expires: undefined };

  class SPgeolocation {
    getInfo() {
      return {
        id: "SPgeolocation",
        name: "Geolocation",
        color1: "#029fe8",
        menuIconURI,
        blockIconURI,
        blocks: [
          {
            opcode: "isAvailiable",
            blockType: Scratch.BlockType.BOOLEAN,
            text: "user allows geolocation?",
            disableMonitor: true
          },
          {
            opcode: "getLocation",
            blockType: Scratch.BlockType.REPORTER,
            text: "get [TYPE]",
            arguments: {
              TYPE: { type: Scratch.ArgumentType.STRING, menu: "TYPES" }
            }
          },
          {
            opcode: "getIP",
            blockType: Scratch.BlockType.REPORTER,
            text: "my IP address",
            disableMonitor: true
          },
          {
            opcode: "getIPInfo",
            blockType: Scratch.BlockType.REPORTER,
            text: "get [TYPE] from IP [IP]",
            arguments: {
              TYPE: { type: Scratch.ArgumentType.STRING, menu: "IP_MENU" },
              IP: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "161.185.160.93"
              }
            }
          },
          {
            opcode: "getCountryName",
            blockType: Scratch.BlockType.REPORTER,
            text: "get country name from code [CODE]",
            arguments: {
              CODE: { type: Scratch.ArgumentType.STRING, defaultValue: "CA" }
            }
          },
          "---",
          {
            opcode: "calculateDistance",
            blockType: Scratch.BlockType.REPORTER,
            text: "distance from lat [LAT1] long [LONG1] to lat [LAT2] long [LONG2] in [UNIT]",
            arguments: {
              UNIT: { type: Scratch.ArgumentType.STRING, menu: "UNITS" },
              LAT1: { type: Scratch.ArgumentType.NUMBER, defaultValue: 0 },
              LAT2: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 },
              LONG1: { type: Scratch.ArgumentType.NUMBER, defaultValue: 0 },
              LONG2: { type: Scratch.ArgumentType.NUMBER, defaultValue: 10 }
            }
          },
          { blockType: Scratch.BlockType.LABEL, text: "Unreliable Blocks" },
          {
            opcode: "getOthers",
            blockType: Scratch.BlockType.REPORTER,
            text: "get [TYPE]",
            arguments: {
              TYPE: {
                type: Scratch.ArgumentType.STRING,
                menu: "TYPES2"
              }
            }
          }
        ],
        menus: {
          TYPES: {
            acceptReporters: true,
            items: ["latitude", "longitude"]
          },
          TYPES2: {
            acceptReporters: true,
            items: ["altitude", "speed"]
          },
          IP_MENU: {
            acceptReporters: true,
            items: [
              { "text": "country name", "value": "countryName" },
              { "text": "country code", "value": "countryCode" },
              { "text": "region", "value": "regionName" },
              { "text": "city", "value": "cityName" },
              { "text": "continent", "value": "continent" },
              { "text": "latitude", "value": "latitude" },
              { "text": "longitude", "value": "longitude" }
            ]
          },
          UNITS: ["miles", "kilometers"]
        }
      };
    }

    async getLocation(args) { return await this.getThing(args.TYPE)}
    async getOthers(args) { return await this.getThing(args.TYPE)}
    isAvailiable() { return Scratch.Cast.toBoolean(navigator.geolocation) }

    async getThing(THING) {
      if (!await Scratch.canGeolocate()) return "";
      if (navigator.geolocation) {
        try {
          const position = await new Promise((resolve, reject) => {
            navigator.geolocation.getCurrentPosition(resolve, reject);
          });
          return (position.coords[THING])? position.coords[THING] : "";
        } catch (e) { return "Error: " + e.message }
      } else { return "Geolocation isn't supported by this browser" }
    }

    async getIP() {
      if (!await Scratch.canGeolocate()) return "";
      try {
        if (ipCache.ip === undefined || Date.now() > (ipCache.expires || 0)) {
          const response = await fetch("https://api.ipify.org?format=json");
          const data = await response.json();
          const ip = data.ip ? data.ip : "";
          if (ip) ipCache = { ip, expires: Date.now() + 30000 }; // 30 sec timeout
          return ip;
        }
        return ipCache.ip || "";
      } catch { return "" }
    }

    async getIPInfo(args) {
      if (!await Scratch.canFetch(`https://freeipapi.com/api/json/${args.IP}`)) return "";
      try {
        const response = await fetch(`https://freeipapi.com/api/json/${args.IP}`);
        const data = await response.json();
        return data[args.TYPE] ? data[args.TYPE] : "";
      } catch { return "" }
    }

    async getCountryName(args) {
      if (!await Scratch.canFetch(`https://corsproxy.io?url=https://api.first.org/data/v1/countries?q=${args.CODE}`)) return "";
      try {
        const response = await fetch(`https://corsproxy.io?url=https://api.first.org/data/v1/countries?q=${args.CODE}`);
        const data = await response.json();
        return data.data[args.CODE].country ? data.data[args.CODE].country : "Invalid Country Code";
      } catch { return "" }
    }

    calculateDistance(args) {
      const radConverter = Math.PI / 180;
      const radlat1 = Scratch.Cast.toNumber(args.LAT1) * radConverter;
      const radlat2 = Scratch.Cast.toNumber(args.LAT2) * radConverter;
      const theta = Scratch.Cast.toNumber(args.LONG1) - Scratch.Cast.toNumber(args.LONG2);
      const radtheta = (Math.PI * theta) / 180;
      let dist =
        Math.sin(radlat1) * Math.sin(radlat2) +
        Math.cos(radlat1) * Math.cos(radlat2) * Math.cos(radtheta);
      dist = Math.acos(dist);
      dist = (dist * 180) / Math.PI;
      dist = dist * 60 * 1.1515;
      if (args.UNIT === "kilometers") dist *= 1.609344;
      return dist;
    }
  }

  Scratch.extensions.register(new SPgeolocation());
})(Scratch);
